const routes = require("next-routes")();

routes.add("/properties/new", "/properties/new");
routes.add("/properties/:address", "/properties/show");
routes.add("/properties/:address/requests", "/campaigns/requests/index");
routes.add("/properties/:address/requests/new", "/campaigns/requests/new");
module.exports = routes;
